(2, 2, 'number of English\'s grammar part', 'Number:\r\nNumber বলতে সাধারন অর্থে সংখ্যাকে বুঝায়। Grammar এর ভাষায়, যা দ্বারা কোন গণনাবাচক noun বা pronoun এর একমাত্রিক বা বহুমাত্রিক অবস্থাকে বুঝানো হয় তাকে Number বা বচন বলে।\r\nTypes of Number:\r\nNumber সাধারনত দুই প্রকার। যথা –\r\nSingular number\r\nPlural number\r\nSingular Number:\r\nযা দ্বারা কোন গণনাবাচক noun বা pronoun এর একক মাত্রাকে বোঝায় তাকে Singular number বা একবচন বলে।\r\nExample:\r\n- Book, Brother, Cow, Tree, etc.\r\nPlural number:\r\nযা দ্বারা কোন গননাবাচক noun বা pronoun এর বহুমাত্রিক অবস্থাকে বোঝায় তাকে Plural number বা বহুবচন বলে।\r\nExample:\r\n- Books, Brothers, Cows, Trees, etc.\r\nSingular number কে Plural Number এ পরিবর্তন করার নিয়ম-\r\nRule 1:\r\nসাধারনত Singular Noun এর শেষে ‘s’ যোগ করে Plural করতে হয় -\r\nSingular	Plural\r\nCow 	cows\r\nBoy	Boys\r\nGirl	Girls\r\nCat	Cats\r\nHouse	Houses\r\nHand	Hands\r\nEye	Eyes\r\nTiger	Tigers\r\nDesk	Desks\r\n\r\nRule 2:\r\nSingular Noun এর শেষে s, ss, sh, x, বা z থাকলে এবং শেষের ch এর উচ্চারণ ‘চ’ এর মত হলে ঐ সব Noun এর শেষে es যোগ করে Plural করতে হয়।\r\n\r\nSingular	Plural\r\nBus	Buses\r\nClass	Classes\r\nBrush	Brushes\r\nBush	Bushes\r\nBox	Boxes\r\nBrunch	Brunches\r\nInch	Inches\r\nWatch	Watches\r\nMatch	matches\r\n\r\nব্যতিক্রম\r\nSingular Noun এর  শেষের ‘ch’ এর উচ্চারণ ‘চ’ এর মত না হয়ে ‘ক’ এর মত হলে ‘es’ যোগ না হয়ে শুধু ‘s’ যোগ হয়ে Plural হবে। যেমন –\r\n\r\nSingular	Plural\r\nStomach	Stomachs\r\nPatriarch	Patriarchs\r\nMonarch	Monarchs', '2023-07-18 11:19:19', '2023-07-22 10:11:39'),
(3, 3, 'React Core Fundamentals', '<h2 id=\"no-breaking-changes\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\">No Breaking Changes</span></h2>\r\n<p><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\">Before we continue, note that Hooks are:</span></p>\r\n<ul style=\"list-style-type: disc;\">\r\n<li style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Completely opt-in.</strong>&nbsp;You can try Hooks in a few components without rewriting any existing code. But you don&rsquo;t have to learn or use Hooks right now if you don&rsquo;t want to.</span></li>\r\n<li style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>100% backwards-compatible.</strong>&nbsp;Hooks don&rsquo;t contain any breaking changes.</span></li>\r\n<li style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Available now.</strong>&nbsp;Hooks are now available with the release of v16.8.0.</span></li>\r\n</ul>\r\n<p><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>There are no plans to remove classes from React.</strong>&nbsp;You can read more about the gradual adoption strategy for Hooks in the&nbsp;<a href=\"https://legacy.reactjs.org/docs/hooks-intro.html#gradual-adoption-strategy\">bottom section</a>&nbsp;of this page.</span></p>\r\n<p><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Hooks don&rsquo;t replace your knowledge of React concepts.</strong>&nbsp;Instead, Hooks provide a more direct API to the React concepts you already know: props, state, context, refs, and lifecycle. As we will show later, Hooks also offer a new powerful way to combine them.</span></p>\r\n<p><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>If you just want to start learning Hooks, feel free to&nbsp;<a href=\"https://legacy.reactjs.org/docs/hooks-overview.html\">jump directly to the next page!</a></strong>&nbsp;You can also keep reading this page to learn more about why we&rsquo;re adding Hooks, and how we&rsquo;re going to start using them without rewriting our applications.</span></p>\r\n<h2 id=\"motivation\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\">Motivation</span></h2>\r\n<p><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\">Hooks solve a wide variety of seemingly unconnected problems in React that we&rsquo;ve encountered over five years of writing and maintaining tens of thousands of components. Whether you&rsquo;re learning React, use it daily, or even prefer a different library with a similar component model, you might recognize some of these problems.</span></p>\r\n<h3 id=\"its-hard-to-reuse-stateful-logic-between-components\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\">It&rsquo;s hard to reuse stateful logic between components</span></h3>\r\n<p><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\">React doesn&rsquo;t offer a way to &ldquo;attach&rdquo; reusable behavior to a component (for example, connecting it to a store). If you&rsquo;ve worked with React for a while, you may be familiar with patterns like&nbsp;<a href=\"https://legacy.reactjs.org/docs/render-props.html\">render props</a>&nbsp;and&nbsp;<a href=\"https://legacy.reactjs.org/docs/higher-order-components.html\">higher-order components</a>&nbsp;that try to solve this. But these patterns require you to restructure your components when you use them, which can be cumbersome and make code harder to follow. If you look at a typical React application in React DevTools, you will likely find a &ldquo;wrapper hell&rdquo; of components surrounded by layers of providers, consumers, higher-order components, render props, and other abstractions. While we could&nbsp;<a href=\"https://github.com/facebook/react-devtools/pull/503\" target=\"_blank\" rel=\"nofollow noopener noreferrer\">filter them out in DevTools</a>, this points to a deeper underlying problem: React needs a better primitive for sharing stateful logic.</span></p>\r\n<p><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\">With Hooks, you can extract stateful logic from a component so it can be tested independently and reused.&nbsp;<strong>Hooks allow you to reuse stateful logic without changing your component hierarchy.</strong>&nbsp;This makes it easy to share Hooks among many components or with the community.</span></p>\r\n<p><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\">We&rsquo;ll discuss this more in&nbsp;<a href=\"https://legacy.reactjs.org/docs/hooks-custom.html\">Building Your Own Hooks</a>.</span></p>\r\n<h3 id=\"complex-components-become-hard-to-understand\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\">Complex components become hard to understand</span></h3>\r\n<p><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\">We&rsquo;ve often had to maintain components that started out simple but grew into an unmanageable mess of stateful logic and side effects. Each lifecycle method often contains a mix of unrelated logic. For example, components might perform some data fetching in&nbsp;<code>componentDidMount</code>&nbsp;and&nbsp;<code>componentDidUpdate</code>. However, the same&nbsp;<code>componentDidMount</code>&nbsp;method might also contain some unrelated logic that sets up event listeners, with cleanup performed in&nbsp;<code>componentWillUnmount</code>. Mutually related code that changes together gets split apart, but completely unrelated code ends up combined in a single method. This makes it too easy to introduce bugs and inconsistencies.</span></p>\r\n<p><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\">In many cases it&rsquo;s not possible to break these components into smaller ones because the stateful logic is all over the place. It&rsquo;s also difficult to test them. This is one of the reasons many people prefer to combine React with a separate state management library. However, that often introduces too much abstraction, requires you to jump between different files, and makes reusing components more difficult.</span></p>\r\n<p><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\">To solve this,&nbsp;<strong>Hooks let you split one component into smaller functions based on what pieces are related (such as setting up a subscription or fetching data)</strong>, rather than forcing a split based on lifecycle methods. You may also opt into managing the component&rsquo;s local state with a reducer to make it more predictable.</span></p>\r\n<p><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\">We&rsquo;ll discuss this more in&nbsp;<a href=\"https://legacy.reactjs.org/docs/hooks-effect.html#tip-use-multiple-effects-to-separate-concerns\">Using the Effect Hook</a>.</span></p>\r\n<h3 id=\"classes-confuse-both-people-and-machines\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\">Classes confuse both people and machines</span></h3>\r\n<p><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\">In addition to making code reuse and code organization more difficult, we&rsquo;ve found that classes can be a large barrier to learning React. You have to understand how&nbsp;<code>this</code>&nbsp;works in JavaScript, which is very different from how it works in most languages. You have to remember to bind the event handlers. Without&nbsp;<a href=\"https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Classes/Public_class_fields#public_instance_fields\" target=\"_blank\" rel=\"nofollow noopener noreferrer\">ES2022 public class fields</a>, the code is very verbose. People can understand props, state, and top-down data flow perfectly well but still struggle with classes. The distinction between function and class components in React and when to use each one leads to disagreements even between experienced React developers.</span></p>\r\n<p><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\">Additionally, React has been out for about five years, and we want to make sure it stays relevant in the next five years. As&nbsp;<a href=\"https://svelte.dev/\" target=\"_blank\" rel=\"nofollow noopener noreferrer\">Svelte</a>,&nbsp;<a href=\"https://angular.io/\" target=\"_blank\" rel=\"nofollow noopener noreferrer\">Angular</a>,&nbsp;<a href=\"https://glimmerjs.com/\" target=\"_blank\" rel=\"nofollow noopener noreferrer\">Glimmer</a>, and others show,&nbsp;<a href=\"https://en.wikipedia.org/wiki/Ahead-of-time_compilation\" target=\"_blank\" rel=\"nofollow noopener noreferrer\">ahead-of-time compilation</a>&nbsp;of components has a lot of future potential. Especially if it&rsquo;s not limited to templates. Recently, we&rsquo;ve been experimenting with&nbsp;<a href=\"https://github.com/facebook/react/issues/7323\" target=\"_blank\" rel=\"nofollow noopener noreferrer\">component folding</a>&nbsp;using&nbsp;<a href=\"https://prepack.io/\" target=\"_blank\" rel=\"nofollow noopener noreferrer\">Prepack</a>, and we&rsquo;ve seen promising early results. However, we found that class components can encourage unintentional patterns that make these optimizations fall back to a slower path. Classes present issues for today&rsquo;s tools, too. For example, classes don&rsquo;t minify very well, and they make hot reloading flaky and unreliable. We want to present an API that makes it more likely for code to stay on the optimizable path.</span></p>\r\n<p><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\">To solve these problems,&nbsp;<strong>Hooks let you use more of React&rsquo;s features without classes.</strong>&nbsp;Conceptually, React components have always been closer to functions. Hooks embrace functions, but without sacrificing the practical spirit of React. Hooks provide access to imperative escape hatches and don&rsquo;t require you to learn complex functional or reactive programming techniques.</span></p>', '2023-12-06 10:45:41', '2023-12-20 13:38:48'),
(8, 3, 'React Core Fundamentals', '<h2 id=\"no-breaking-changes\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\">No Breaking Changes</span></h2>\r\n<p><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\">Before we continue, note that Hooks are:</span></p>\r\n<ul style=\"list-style-type: disc;\">\r\n<li style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Completely opt-in.</strong>&nbsp;You can try Hooks in a few components without rewriting any existing code. But you don&rsquo;t have to learn or use Hooks right now if you don&rsquo;t want to.</span></li>\r\n<li style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>100% backwards-compatible.</strong>&nbsp;Hooks don&rsquo;t contain any breaking changes.</span></li>\r\n<li style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Available now.</strong>&nbsp;Hooks are now available with the release of v16.8.0.</span></li>\r\n</ul>\r\n<p><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>There are no plans to remove classes from React.</strong>&nbsp;You can read more about the gradual adoption strategy for Hooks in the&nbsp;<a href=\"https://legacy.reactjs.org/docs/hooks-intro.html#gradual-adoption-strategy\">bottom section</a>&nbsp;of this page.</span></p>\r\n<p><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Hooks don&rsquo;t replace your knowledge of React concepts.</strong>&nbsp;Instead, Hooks provide a more direct API to the React concepts you already know: props, state, context, refs, and lifecycle. As we will show later, Hooks also offer a new powerful way to combine them.</span></p>\r\n<p><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>If you just want to start learning Hooks, feel free to&nbsp;<a href=\"https://legacy.reactjs.org/docs/hooks-overview.html\">jump directly to the next page!</a></strong>&nbsp;You can also keep reading this page to learn more about why we&rsquo;re adding Hooks, and how we&rsquo;re going to start using them without rewriting our applications.</span></p>\r\n<h2 id=\"motivation\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\">Motivation</span></h2>\r\n<p><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\">Hooks solve a wide variety of seemingly unconnected problems in React that we&rsquo;ve encountered over five years of writing and maintaining tens of thousands of components. Whether you&rsquo;re learning React, use it daily, or even prefer a different library with a similar component model, you might recognize some of these problems.</span></p>\r\n<h3 id=\"its-hard-to-reuse-stateful-logic-between-components\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\">It&rsquo;s hard to reuse stateful logic between components</span></h3>\r\n<p><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\">React doesn&rsquo;t offer a way to &ldquo;attach&rdquo; reusable behavior to a component (for example, connecting it to a store). If you&rsquo;ve worked with React for a while, you may be familiar with patterns like&nbsp;<a href=\"https://legacy.reactjs.org/docs/render-props.html\">render props</a>&nbsp;and&nbsp;<a href=\"https://legacy.reactjs.org/docs/higher-order-components.html\">higher-order components</a>&nbsp;that try to solve this. But these patterns require you to restructure your components when you use them, which can be cumbersome and make code harder to follow. If you look at a typical React application in React DevTools, you will likely find a &ldquo;wrapper hell&rdquo; of components surrounded by layers of providers, consumers, higher-order components, render props, and other abstractions. While we could&nbsp;<a href=\"https://github.com/facebook/react-devtools/pull/503\" target=\"_blank\" rel=\"nofollow noopener noreferrer\">filter them out in DevTools</a>, this points to a deeper underlying problem: React needs a better primitive for sharing stateful logic.</span></p>\r\n<p><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\">With Hooks, you can extract stateful logic from a component so it can be tested independently and reused.&nbsp;<strong>Hooks allow you to reuse stateful logic without changing your component hierarchy.</strong>&nbsp;This makes it easy to share Hooks among many components or with the community.</span></p>\r\n<p><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\">We&rsquo;ll discuss this more in&nbsp;<a href=\"https://legacy.reactjs.org/docs/hooks-custom.html\">Building Your Own Hooks</a>.</span></p>\r\n<h3 id=\"complex-components-become-hard-to-understand\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\">Complex components become hard to understand</span></h3>\r\n<p><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\">We&rsquo;ve often had to maintain components that started out simple but grew into an unmanageable mess of stateful logic and side effects. Each lifecycle method often contains a mix of unrelated logic. For example, components might perform some data fetching in&nbsp;<code>componentDidMount</code>&nbsp;and&nbsp;<code>componentDidUpdate</code>. However, the same&nbsp;<code>componentDidMount</code>&nbsp;method might also contain some unrelated logic that sets up event listeners, with cleanup performed in&nbsp;<code>componentWillUnmount</code>. Mutually related code that changes together gets split apart, but completely unrelated code ends up combined in a single method. This makes it too easy to introduce bugs and inconsistencies.</span></p>\r\n<p><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\">In many cases it&rsquo;s not possible to break these components into smaller ones because the stateful logic is all over the place. It&rsquo;s also difficult to test them. This is one of the reasons many people prefer to combine React with a separate state management library. However, that often introduces too much abstraction, requires you to jump between different files, and makes reusing components more difficult.</span></p>\r\n<p><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\">To solve this,&nbsp;<strong>Hooks let you split one component into smaller functions based on what pieces are related (such as setting up a subscription or fetching data)</strong>, rather than forcing a split based on lifecycle methods. You may also opt into managing the component&rsquo;s local state with a reducer to make it more predictable.</span></p>\r\n<p><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\">We&rsquo;ll discuss this more in&nbsp;<a href=\"https://legacy.reactjs.org/docs/hooks-effect.html#tip-use-multiple-effects-to-separate-concerns\">Using the Effect Hook</a>.</span></p>\r\n<h3 id=\"classes-confuse-both-people-and-machines\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\">Classes confuse both people and machines</span></h3>\r\n<p><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\">In addition to making code reuse and code organization more difficult, we&rsquo;ve found that classes can be a large barrier to learning React. You have to understand how&nbsp;<code>this</code>&nbsp;works in JavaScript, which is very different from how it works in most languages. You have to remember to bind the event handlers. Without&nbsp;<a href=\"https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Classes/Public_class_fields#public_instance_fields\" target=\"_blank\" rel=\"nofollow noopener noreferrer\">ES2022 public class fields</a>, the code is very verbose. People can understand props, state, and top-down data flow perfectly well but still struggle with classes. The distinction between function and class components in React and when to use each one leads to disagreements even between experienced React developers.</span></p>\r\n<p><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\">Additionally, React has been out for about five years, and we want to make sure it stays relevant in the next five years. As&nbsp;<a href=\"https://svelte.dev/\" target=\"_blank\" rel=\"nofollow noopener noreferrer\">Svelte</a>,&nbsp;<a href=\"https://angular.io/\" target=\"_blank\" rel=\"nofollow noopener noreferrer\">Angular</a>,&nbsp;<a href=\"https://glimmerjs.com/\" target=\"_blank\" rel=\"nofollow noopener noreferrer\">Glimmer</a>, and others show,&nbsp;<a href=\"https://en.wikipedia.org/wiki/Ahead-of-time_compilation\" target=\"_blank\" rel=\"nofollow noopener noreferrer\">ahead-of-time compilation</a>&nbsp;of components has a lot of future potential. Especially if it&rsquo;s not limited to templates. Recently, we&rsquo;ve been experimenting with&nbsp;<a href=\"https://github.com/facebook/react/issues/7323\" target=\"_blank\" rel=\"nofollow noopener noreferrer\">component folding</a>&nbsp;using&nbsp;<a href=\"https://prepack.io/\" target=\"_blank\" rel=\"nofollow noopener noreferrer\">Prepack</a>, and we&rsquo;ve seen promising early results. However, we found that class components can encourage unintentional patterns that make these optimizations fall back to a slower path. Classes present issues for today&rsquo;s tools, too. For example, classes don&rsquo;t minify very well, and they make hot reloading flaky and unreliable. We want to present an API that makes it more likely for code to stay on the optimizable path.</span></p>\r\n<p><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\">To solve these problems,&nbsp;<strong>Hooks let you use more of React&rsquo;s features without classes.</strong>&nbsp;Conceptually, React components have always been closer to functions. Hooks embrace functions, but without sacrificing the practical spirit of React. Hooks provide access to imperative escape hatches and don&rsquo;t require you to learn complex functional or reactive programming techniques.</span></p>', '2023-12-20 13:51:35', '2023-12-20 13:51:35');
